import React from 'react'
import Card from './Card'

function Cards() {
    const recipe = useSelector(state => state.recipe)//TRAETE DEL ESTADO EL RECIPE
    return (
        <div>
           {
                recipe.length>0 ? 
                <div>
                    {recipe.map((e, index) => {
                        <Card img={e.image} />
                    })}
                </div>
                :
                <h1>Cargando...</h1>
           }
        </div>
    )
}

export default Cards
